import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import { Formik } from "formik";
import { useDispatch } from "react-redux";
import { fetchListToDoById, } from "../../../redux/actions/todoActions";
import Button from "@material-ui/core/Button";
import SearchIcon from "@material-ui/icons/Search";


const useStyles = makeStyles((theme) => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
}));

export default function Search() {
    const classes = useStyles();
    const dispatch = useDispatch();
    return (
        <div style={{ display: "flexbox", justifyContent: "center", textAlign: "center", padding: "30px" }}>
            <Formik
                initialValues={{ createdAt: "" }}
                onSubmit={(values) => {
                    dispatch(fetchListToDoById(values));
                    console.log(values, "values");

                    // setTimeout(() => {
                    //     alert(JSON.stringify(values, null, 2));
                    //     setSubmitting(false);
                    // }, 400);
                }}
            >
                {({
                    values,
                    errors,
                    touched,
                    handleChange,
                    handleBlur,
                    handleSubmit,
                    isSubmitting,
                    /* and other goodies */
                }) => (
                        <form className={classes.root} noValidate autoComplete="off">
                            <TextField id="standard-secondary" label="Cari Berdasar Tanggal" color="primary" />
                            <Button
                                variant="contained"
                                color="primary"
                                type="submit"
                                style={{ marginLeft: 1 }}
                            >
                             <SearchIcon />
                            </Button>
                        </form>
                    )}
            </Formik>
        </div>
    );
}
